function isString(uData){
	return typeof(uData)=="string";
};
function isNumber(uData){
	return (typeof(uData)=="number"&&(!isNaN(uData)));
};
function isBool(uData){
	return typeof(uData)=="boolean";
};
function isFunction(uData){
	return typeof(uData)=="function";
};
function isObject(uData){
	if((uData)&&(typeof(uData)=="object")) return true; 
	else return false;
};
function isArray(uData){
	return Object.prototype.toString.call(uData) === "[object Array]";
};
//生成随机数
function randStr(len,char,num,ext) {
	len = len || 16;
	char= (isBool(char)?char:true);
	num= (isBool(num)?num:true);
	ext=(isBool(ext)?ext:false);
	var chars='';
	if(char) chars+='abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ';
	if(num) chars+='0123456789';
	if(ext) chars+='!@#$%^&*()-_ []{}<>~`+=,.;:/?|';
	var maxPos = chars.length;
	var pwd = '';
	for (i = 0; i < len; i++) {
		pwd += chars.charAt(Math.floor(Math.random() * maxPos));
	}
	return pwd;
};
function getUrlParam(sUrl){
	var aParam=[],aTmp=[],aTemp=sUrl.split("?");
	if(aTemp.length<2) return aParam;
	aTemp=aTemp[1].split("&");
	var sKey="",sValue="";
	for(var i=0;i<aTemp.length;i++){
		aTmp=aTemp[i].split("=");
		sKey=aTmp[0];
		sValue=aTmp.length==2?aTmp[1]:"";
		aParam[sKey]=sValue;
	}
	return aParam;
};
//显示等待提示框
function fyShowWait(sTitle,sImgSrc){
	sTitle=sTitle||"执行中";
	 sImgSrc=sImgSrc||"data:image/gif;base64,"
	var sHtml="<img src=\""+sImgSrc+"\" style=\"width:100px;height:100px;margin-left:40%\"></img>";
	return fyDialog(sTitle,sHtml,null,null,null,null,{
		backdrop:false,
		keyboard:false
	},true);
};
//关闭等待提示框
function fyCloseWait(oDialog){
	oDialog=oDialog||$(".fymodal");
	oDialog.modal("hide");
};
//飞跃通用js函数模块
function fyAlert(sTitle,sText,fnSuccess,sType,fnCancel,bCloseConfirm,bCloseCancel){
	sTitle=sTitle||"确定?";
	sType=sType||"success";
	bCloseConfirm=isBool(bCloseConfirm)?bCloseConfirm:true;
	bCloseCancel=isBool(bCloseCancel)?bCloseCancel:true;
	swal({   
		title: sTitle,   
		text: sText,   
		type: sType,   
		showCancelButton: !!fnCancel, 
		confirmButtonColor: "#DD6B55",   
		confirmButtonText: "确定",   
		cancelButtonText: "取消",   
		closeOnConfirm: bCloseConfirm,
		closeOnCancel: bCloseCancel
	}, function(isConfirm){
		if(!fnSuccess) return;
		if(!fnCancel) fnSuccess.call(this,isConfirm);
		else{
			if(isConfirm) fnSuccess.call(this);
			else if(isFunction(fnCancel))fnCancel.call(this);
		}
	});
}
/*弹出框
* 依赖bootstrap.js
* sTitle：标题
* sCotent：内容，可以为纯文本、html代码、url，当为url时候，必须以http://开头
* fnSuccess：点击保存按钮时候执行的回调函数
* fnCancel：点击取消按钮时候执行的回调函数
*/
function fyDialog(sTitle,sContent,fnSuccess,fnCancel,iWidth,iHeight,oOption,bNoButton){
	var oDialog=$(".fymodal");
	iWidth=iWidth||600;
	iHeight=iHeight||367;
	oOption={
		backdrop:false,
		keyboard:false
	};
	bNoButton=bNoButton||false;
	if(oDialog.length==0){
		oDialog=$("<div class=\"modal inmodal fymodal\" style=\"display:none;\">"
			+"<div class=\"modal-dialog\" id=\"fyModal_Dialog\" >"
			+"<div class=\"modal-content animated bounceInRight\" id=\"fyModal_Content\">"
			+"</div></div></div>");
		var oChild=oDialog.children().children();
		var oTitle=$("<div class=\"modal-header\">"
			+"<button type=\"button\" class=\"close\" id=\"fyModalClose\" data-dismiss=\"modal\">"
			+"<span aria-hidden=\"true\">&times;</span></button>"
			+"<h4 class=\"modal-title\" id=\"fyModalTitle\"></h4></div>");
		oChild.append(oTitle);
		var oBody=$("<div class=\"modal-body\" id=\"fyModalBody\"></div>");
		var oContent=null,oFrame=null;
		oFrame=$("<iframe id=\"fyModalFrame\" src=\"\" style=\"width:100%;height:100%;\" frameborder=\"0\"></iframe>").hide();
		oContent=$("<div id=\"fyModalContent\" style=\"width:100%;height:100%;overflow:auto;\"></div>").hide();
		oBody.append(oFrame);
		oBody.append(oContent);
		oChild.append(oBody);
		var oFooter=$("<div class=\"modal-footer\"></div>");
		oChild.append(oFooter);
		var oSuccess=$("<button type=\"button\" class=\"btn btn-primary\" id=\"fyModalSave\">保存</button>");
		oFooter.append(oSuccess);
		var oCancel=$("<button type=\"button\" class=\"btn btn-white\" data-dismiss=\"modal\" id=\"fyModalCancle\">关闭</button>");
		oFooter.append(oCancel);
		$("body").append(oDialog);
	}
	//根据新内容修正旧内容
	$("#fyModalTitle").html(sTitle);
	if(sContent.indexOf('https://')==0 || sContent.indexOf('http://')==0){
		if(sContent==$("#fyModalFrame").attr("src")) $("#fyModalFrame").show();
		else $("#fyModalFrame").attr("src",sContent).show();
		$("#fyModalContent").hide();
	}else{
		$("#fyModalContent").html(sContent).show();
		$("#fyModalFrame").hide();
	}
	if(isFunction(fnSuccess)){
		$("#fyModalSave").click(function(){
			fnSuccess.call(this);
			oDialog.modal("hide");
		}).show();
	}else{
		$("#fyModalSave").hide();
	}
	$("#fyModalCancle").click(function(){
		if(isFunction(fnCancel)) fnCancel.call(this);
		oDialog.modal("hide");
	});
	if(bNoButton){
		$("#fyModalSave").hide();
		$("#fyModalCancle").hide();
		$("#fyModalClose").hide();
	}
	$("#fyModal_Dialog").width(iWidth);
	$("#fyModal_Content").height(iHeight);
	$("#fyModalBody").height(200+(iHeight-365)-50);
	oDialog.modal(oOption);
	oDialog.modal("show");
	return oDialog;
}
//图片预览
//uUrl，图片的路径
function fyImgPreview(uUrl){
	//先判断当前页面是否存在必要的dom元素
	if($(".lightBoxGallery").length==0){
		//创建元素
		var oBody=$("<div class=\"lightBoxGallery\">"
			+"<div id=\"blueimp-gallery\" class=\"blueimp-gallery\">"
			+"<div class=\"slides\"></div><h3 class=\"title\"></h3><a class=\"prev\">‹</a>"
			+"<a class=\"next\">›</a><a class=\"close\">×</a><a class=\"play-pause\"></a>"
			+"<ol class=\"indicator\"></ol>"
			+"</div></div>");
		$("body").append(oBody);
	}
	var aUrl=null;
	if(isArray(uUrl)){
		aUrl=uUrl;
	}else{
		aUrl=[uUrl];
	}
	var oGallery = blueimp.Gallery(aUrl);
	oGallery.slide(0, 500);
}

// this is a Jquery plugin function that fires an event when the size of an element is changed
// usage: $().sizeChanged(function(){})

(function ($) {

$.fn.sizeChanged = function (handleFunction) {
    var element = this;
    var lastWidth = element.width();
    var lastHeight = element.height();

    setInterval(function () {
        if (lastWidth === element.width()&&lastHeight === element.height())
            return;
        if (typeof (handleFunction) == 'function') {
            handleFunction({ width: lastWidth, height: lastHeight },
                           { width: element.width(), height: element.height() });
            lastWidth = element.width();
            lastHeight = element.height();
        }
    }, 100);
    return element;
};

}(jQuery));


/**
 *
 * @param name  参数
 * @param value 参数值
 * @param url   要改变的url
 * @returns {string}  返回xinurl
 * @constructor
 */
function ChangeParam(name,value,url){
    var newUrl="";
    var reg = new RegExp("(^|)"+ name +"=([^&]*)(|$)");
    var tmp = name + "=" + value;
    if(url.match(reg) != null){
        newUrl= url.replace(eval(reg),tmp);
    }else {
        if(url.match("[\?]")){
            newUrl= url + "&" + tmp;
        }
        else {
            newUrl= url + "?" + tmp;
        }
    }
    return newUrl;
}


//获取指定url参数
function getURLParam(strParamName, url) {
    var strReturn = "";
    var strHref = url.toLowerCase();
    if (strHref.indexOf("?") > -1) {
        var strQueryString = strHref.substr(strHref.indexOf("?") + 1).toLowerCase();
        var aQueryString = strQueryString.split("&");
        for (var iParam = 0; iParam < aQueryString.length; iParam++) {
            if (aQueryString[iParam].indexOf(strParamName.toLowerCase() + "=") > -1) {
                var aParam = aQueryString[iParam].split("=");
                strReturn = aParam[1];
                break;
            }
        }
    }
    return strReturn;
}








